import './card.css';

const MovieCard = ({imgSrc,movieName, ticketCost, rating, duration}) => {
    return (
        <div className="card">
            <img src={imgSrc} className="movieImg"/>
            <h1>{movieName}</h1>
            <p>{ticketCost}</p>
            <div className='content'>
                <p>{duration}</p>
                <p>{rating}</p>
            </div>
        </div>
    )
}
export default MovieCard;
